import React from 'react'
import { AppBar, Typography, Toolbar, Avatar, Button } from '@material-ui/core'
import useStyles from './styles'
import memories from '../../images/pandabnw_p.png'
import {Link} from 'react-router-dom'

const Navbar = () => {
    const classes = useStyles();
    const user = null;

    return (
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
                <Typography component={Link} to= "/" className={classes.heading} variant="h2" align="center">PANda 3</Typography>
                <img className={classes.image} src={memories} alt="memories" height="100" width="100" />
            </div>
            <Toolbar className={classes.toolbar}>
                {user ? (
                    <div className={classes.profile}>
                        <Avatar className={classes.purple} alt={user.result.name} src = {user.result.imageUrl}>{user.result.name.charAt(0)}</Avatar>
                        <Typography className={classes.userName} variant="h6">{user.result.name}</Typography>
                        <Button variant = "container" className= {classes.logout} color = "secondary" >Log out</Button>
                    </div>
                ) : (
                    <div>

                    </div>
                )}
            </Toolbar>
        </AppBar>
    );
}

export default Navbar;
